import React from 'react';
import './skills.css';

function Skills() {
  return (
    <div className="grid-item skills">
      <h2>Skills</h2>
      <div className="container">
        <div className="row">
          <div className="bar">
            <div className="info">
              <p>HTML</p>
              <p>80%</p>
            </div>
          </div>
          <div className="bar">
            <div className="info">
              <p>CSS</p>
              <p>70%</p>
            </div>
          </div>
          {/* Add more skill bars */}
        </div>
      </div>
    </div>
  );
}

export default Skills;
